namespace RonSijm.FluidHumidifier.Factories.Amplify;

public class AppFactory(string resourceName = null, Action<Humidifier.Amplify.App> factoryAction = null) : ResourceFactory<Humidifier.Amplify.App>(resourceName)
{

    internal List<InnerAppEnvironmentVariableFactory> EnvironmentVariablesFactories { get; set; } = [];

    internal List<InnerAppCustomRuleFactory> CustomRulesFactories { get; set; } = [];

    internal InnerAppAutoBranchCreationConfigFactory AutoBranchCreationConfigFactory { get; set; }

    internal InnerAppBasicAuthConfigFactory BasicAuthConfigFactory { get; set; }

    internal InnerAppCacheConfigFactory CacheConfigFactory { get; set; }

    protected override Humidifier.Amplify.App Create()
    {
        var appResult = CreateApp();
        factoryAction?.Invoke(appResult);

        return appResult;
    }

    private Humidifier.Amplify.App CreateApp()
    {
        var appResult = new Humidifier.Amplify.App
        {
            GivenName = InputResourceName,
        };

        return appResult;
    }
    public override void CreateChildren(Humidifier.Amplify.App result)
    {
        base.CreateChildren(result);

        result.EnvironmentVariables = EnvironmentVariablesFactories.Any() ? EnvironmentVariablesFactories.Select(x => x.Build()).ToList() : null;
        result.CustomRules = CustomRulesFactories.Any() ? CustomRulesFactories.Select(x => x.Build()).ToList() : null;
        result.AutoBranchCreationConfig ??= AutoBranchCreationConfigFactory?.Build();
        result.BasicAuthConfig ??= BasicAuthConfigFactory?.Build();
        result.CacheConfig ??= CacheConfigFactory?.Build();
    }

} // End Of Class

